import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const Pacientes = () => {
    const [data, setData] = useState([]);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const token = localStorage.getItem('token');
                const response = await axios.get('http://localhost:3002/api/persona/listar', {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });
                console.log('Fetched data:', response.data);
                setData(response.data.data || []);
            } catch (error) {
                console.error('Error fetching data:', error.response ? error.response.data : error.message);
                setError(error.response ? error.response.data.message : error.message);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            {error && <p>Error: {error}</p>}
            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>#</TableCell>
                            <TableCell>Apellido Paterno</TableCell>
                            <TableCell>Apellido Materno</TableCell>
                            <TableCell>Nombre</TableCell>
                            <TableCell>Fecha de Nacimiento</TableCell>
                            <TableCell>Sexo</TableCell>
                            <TableCell>Estado Civil</TableCell>
                            <TableCell>Número de Documento</TableCell>
                            <TableCell>Dirección</TableCell>
                            <TableCell>Teléfono</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {data.map(row => (
                            <TableRow key={row.idpersona}>
                                <TableCell>{row.idpersona}</TableCell>
                                <TableCell>{row.apaterno}</TableCell>
                                <TableCell>{row.amaterno}</TableCell>
                                <TableCell>{row.nombre}</TableCell>
                                <TableCell>{row.fecha_nacimiento}</TableCell>
                                <TableCell>{row.sexo}</TableCell>
                                <TableCell>{row.estado_civil}</TableCell>
                                <TableCell>{row.num_documento}</TableCell>
                                <TableCell>{row.direccion}</TableCell>
                                <TableCell>{row.telefono}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    );
};

export default Pacientes;
